// eslint-disable-next-line @typescript-eslint/no-unused-vars
export class Edit {
}
export class Input extends Edit {
    input;
    type = 'Input';
    constructor(input) {
        super();
        this.input = input;
    }
}
export class Error extends Edit {
    input;
    error;
    type = 'Error';
    constructor(input, error) {
        super();
        this.input = input;
        this.error = error;
    }
}
export class Value extends Edit {
    value;
    type = 'Value';
    constructor(value) {
        super();
        this.value = value;
    }
}
